import React from 'react';
import mapa from "../../Utils/Img/Localidad/mapa.png";
import './cajalocalidades.css';


function Cajamapa() {
	return (
	 
		 
	   
		<div className="Contenidolocalidad">
  
  
		<img id="imglocalidad" src={Mapa} alt="Esta es la img"/>
	  
		</div>
	  
		
			
	  
	  
  
	 
	);
  }
  
  export default Cajamapa;
